import React, { useState, useRef, useEffect } from 'react';
import './FloatingChatbot.css';

interface Message {
  role: 'user' | 'assistant';
  content: string;
  timestamp: Date;
}

const FloatingChatbot: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [messages, setMessages] = useState<Message[]>([
    {
      role: 'assistant',
      content: "Kumusta! I'm your malunggay expert. Ask me anything about planting, diseases, nutrition, or selling malunggay! üåø",
      timestamp: new Date()
    }
  ]);
  const [inputMessage, setInputMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const messagesEndRef = useRef<HTMLDivElement>(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

 const handleSendMessage = async () => {
  if (!inputMessage.trim() || isLoading) return;

  const userMessage: Message = {
    role: 'user',
    content: inputMessage,
    timestamp: new Date()
  };

  setMessages(prev => [...prev, userMessage]);
  setInputMessage('');
  setIsLoading(true);

  try {
    const response = await fetch('http://localhost:5000/api/chat', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        message: inputMessage,
        history: messages.slice(-6).map(m => ({ 
          role: m.role, 
          content: m.content 
        }))
      }),
    });

    if (!response.ok) throw new Error('API request failed');

    const data = await response.json();

    const assistantMessage: Message = {
      role: 'assistant',
      content: data.message,
      timestamp: new Date()
    };

    setMessages(prev => [...prev, assistantMessage]);
  } catch (error) {
    console.error('Chat error:', error);
    const errorMessage: Message = {
      role: 'assistant',
      content: 'Sorry, I encountered an error. Please make sure the backend is running.',
      timestamp: new Date()
    };
    setMessages(prev => [...prev, errorMessage]);
  } finally {
    setIsLoading(false);
  }
};

  const handleKeyPress = (e: React.KeyboardEvent) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      handleSendMessage();
    }
  };

  const getMockResponse = (query: string): string => {
    const lowerQuery = query.toLowerCase();
    
    if (lowerQuery.includes('plant') || lowerQuery.includes('grow') || lowerQuery.includes('tanim')) {
      return "To plant malunggay from cuttings:\n\n1. Cut a 12-18 inch branch from a mature tree (1-2 inches thick)\n2. Plant at 45-degree angle\n3. Bury 6 inches deep in well-draining soil\n4. Water thoroughly\n5. New roots develop in 7-14 days! üå±\n\nTip: Plant at the start of rainy season (May-June) for best results.";
    }
    
    if (lowerQuery.includes('harvest') || lowerQuery.includes('ani') || lowerQuery.includes('kuha')) {
      return "Best time to harvest malunggay leaves:\n\n‚è∞ Early morning (6-8 AM) - most nutritious\nüåø Pick young, tender leaves\nüìè When plant is 1.5-2 meters tall\n‚úÇÔ∏è Use clean scissors\nüìÖ Harvest every 2-4 weeks\n\nTip: Don't harvest more than 30% of the plant at once. This keeps it healthy and productive!";
    }
    
    if (lowerQuery.includes('disease') || lowerQuery.includes('yellow') || lowerQuery.includes('sakit') || lowerQuery.includes('dilaw')) {
      return "Yellow leaves can mean:\n\n1. üíß Overwatering - Let soil dry between watering\n2. üå± Nitrogen deficiency - Add organic compost\n3. üçÇ Natural aging - Lower leaves turn yellow normally\n\nQuick fix: Check if soil is too wet. If yes, reduce watering. If soil is dry, add compost around the base.";
    }
    
    if (lowerQuery.includes('price') || lowerQuery.includes('sell') || lowerQuery.includes('presyo') || lowerQuery.includes('bili')) {
      return "Current malunggay market prices:\n\nüåø Fresh leaves: ‚Ç±50-80 per bundle\nüíä Dried powder: ‚Ç±120-200 per 100g\nüíä Capsules: ‚Ç±250-400 per 60 pcs\nüå± Seeds: ‚Ç±50-100 per 100g\n\nüí° Pro tip: Organic products fetch 30-50% higher prices! Best selling channels are health food stores and online (Facebook, Shopee, Lazada).";
    }
    
    if (lowerQuery.includes('nutrition') || lowerQuery.includes('vitamin') || lowerQuery.includes('benefit')) {
      return "Malunggay is a SUPERFOOD! Per 100g of fresh leaves:\n\nü•ï Vitamin A: 6,780 Œºg (excellent for eyes)\nüçä Vitamin C: 51.7 mg (boosts immunity)\nüí™ Iron: 4.0 mg (prevents anemia)\nü•õ Calcium: 185 mg (strong bones)\nü•© Protein: 9.4 g (muscle building)\n\nBenefits: Increases breast milk, lowers blood sugar, reduces inflammation, improves digestion!";
    }
    
    if (lowerQuery.includes('recipe') || lowerQuery.includes('cook') || lowerQuery.includes('luto')) {
      return "Easy Malunggay Recipes:\n\n1. üç≤ Tinolang Manok - Add leaves in last 2 minutes\n2. ü•ö Ginisang Malunggay - Saut√© with eggs, garlic, tomato\n3. üçµ Malunggay Tea - Boil water, steep leaves 5 mins\n4. ü•§ Smoothie - Blend with banana, pineapple, milk\n5. üçû Pandesal - Mix powder into dough\n\nTip: Add malunggay LAST when cooking to preserve nutrients and color!";
    }
    
    if (lowerQuery.includes('water') || lowerQuery.includes('tubig') || lowerQuery.includes('dilig')) {
      return "Watering schedule for malunggay:\n\nüå± Young plants (0-2 months): Every 2-3 days\nüåø Mature plants (3+ months): 1-2 times per week\n‚òÄÔ∏è Dry season: Increase frequency\nüåßÔ∏è Rainy season: Reduce or skip watering\n\nüí° Tip: Malunggay is drought-tolerant! Better to underwater than overwater. Check soil - if top 2 inches are dry, it's time to water.";
    }
    
    if (lowerQuery.includes('fertilizer') || lowerQuery.includes('pataba') || lowerQuery.includes('compost')) {
      return "Best fertilizers for malunggay:\n\n1. üåæ Organic compost - Every 4-6 weeks (2-3 kg per tree)\n2. üêî Chicken manure - Every 2-3 months (must be composted!)\n3. ü™± Vermicompost - Monthly (1 kg per tree)\n4. üåø 14-14-14 Complete - Every 2 months (50-100g)\n\nTip: Organic is better if you're eating the leaves fresh! Apply around base, not touching the stem.";
    }
    
    if (lowerQuery.includes('pest') || lowerQuery.includes('insect') || lowerQuery.includes('kulisap')) {
      return "Common malunggay pests:\n\nüêõ Aphids - Spray with water or neem oil\nüêõ Caterpillars - Hand-pick or use Bt organic pesticide\nüêú Ants - Usually farming aphids, control aphids first\n\nOrganic pest control:\n- Neem oil spray (2 tbsp per liter water)\n- Garlic spray (crush 2 cloves in water)\n- Plant marigolds nearby (natural repellent)\n\nInspect plants weekly for early detection!";
    }
    
    if (lowerQuery.includes('hello') || lowerQuery.includes('hi') || lowerQuery.includes('kumusta')) {
      return "Hello! Kumusta! üëã I'm here to help with all your malunggay questions!\n\nI can help you with:\nüå± Planting and growing tips\nüî¨ Disease and pest solutions\nü•ó Nutrition information\nüí∞ Market prices and selling\nüç≤ Recipes and cooking\nüíß Watering and fertilizing\n\nWhat would you like to know about malunggay?";
    }
    
    if (lowerQuery.includes('thank') || lowerQuery.includes('salamat')) {
      return "You're welcome! Walang anuman! üòä\n\nFeel free to ask me anything else about malunggay. I'm here to help you grow healthy, profitable malunggay plants! üåø";
    }
    
    return "I can help you with:\n\nüå± Planting malunggay (from cuttings or seeds)\n‚è∞ Best harvest timing\nüî¨ Disease identification and treatment\nü•ó Nutritional benefits\nüí∞ Current market prices\nüç≤ Cooking recipes\nüíß Watering schedule\nüåæ Fertilizer recommendations\n\nJust ask me anything! For example: 'How to plant malunggay?' or 'What are the benefits?'";
  };

  const quickQuestions = [
    "How to plant malunggay?",
    "When to harvest?",
    "Malunggay benefits?",
    "Current prices?"
  ];

  return (
    <>
      {/* Chat Button */}
      <div 
        className={`chat-fab ${isOpen ? 'hidden' : ''}`}
        onClick={() => setIsOpen(true)}
      >
        <span className="chat-icon">üí¨</span>
      </div>

      {/* Chat Window */}
      {isOpen && (
        <div className="chat-window">
          {/* Header */}
          <div className="chat-header">
            <div className="chat-header-content">
              <div className="chat-avatar">üåø</div>
              <div className="chat-header-info">
                <div className="chat-header-title">Malunggay Expert</div>
                <div className="chat-header-status">‚óè Online</div>
              </div>
            </div>
            <button 
              className="chat-close-btn"
              onClick={() => setIsOpen(false)}
            >
              ‚úï
            </button>
          </div>

          {/* Messages */}
          <div className="chat-messages">
            {messages.map((msg, idx) => (
              <div 
                key={idx} 
                className={`chat-message ${msg.role}`}
              >
                {msg.role === 'assistant' && (
                  <div className="chat-message-avatar">ü§ñ</div>
                )}
                <div className="chat-message-bubble">
                  {msg.content}
                </div>
                {msg.role === 'user' && (
                  <div className="chat-message-avatar user">üë§</div>
                )}
              </div>
            ))}
            
            {isLoading && (
              <div className="chat-message assistant">
                <div className="chat-message-avatar">ü§ñ</div>
                <div className="chat-message-bubble">
                  <div className="typing-indicator">
                    <span></span>
                    <span></span>
                    <span></span>
                  </div>
                </div>
              </div>
            )}
            
            <div ref={messagesEndRef} />
          </div>

          {/* Quick Questions */}
          {messages.length <= 1 && (
            <div className="quick-questions">
              {quickQuestions.map((q, idx) => (
                <button
                  key={idx}
                  className="quick-question-btn"
                  onClick={() => setInputMessage(q)}
                >
                  {q}
                </button>
              ))}
            </div>
          )}

          {/* Input Area */}
          <div className="chat-input-area">
            <input
              type="text"
              className="chat-input"
              placeholder="Ask about malunggay..."
              value={inputMessage}
              onChange={(e) => setInputMessage(e.target.value)}
              onKeyPress={handleKeyPress}
              disabled={isLoading}
            />
            <button 
              className="chat-send-btn"
              onClick={handleSendMessage}
              disabled={!inputMessage.trim() || isLoading}
            >
              ‚û§
            </button>
          </div>
        </div>
      )}
    </>
  );
};

export default FloatingChatbot;
